  `goods_type_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品属性所属类型id',
  `spec_type_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品规格所属类型id',
  `give_integral` mediumint(8) NOT NULL DEFAULT '0' COMMENT '购买商品赠送积分',
  `exchange_integral` int(10) NOT NULL DEFAULT '0' COMMENT '积分兑换：0不参与积分兑换，积分和现金的兑换比例见后台配置',
  `sales_sum` int(11) NOT NULL DEFAULT '0' COMMENT '商品销量',
  `prom_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 普通订单,1 限时抢购, 2 团购 , 3 促销优惠',
  `goods_prom_id` int(11) NOT NULL DEFAULT '0' COMMENT '优惠活动id',
  `shipping_area_ids` varchar(255) NOT NULL DEFAULT '' COMMENT '配送物流shipping_area_id,以逗号分隔',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `goods_category_id` (`goods_category_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `goods_name` (`goods_name`),
  KEY `goods_brand_id` (`goods_brand_id`),
  KEY `store_count` (`store_count`),
  KEY `weight` (`weight`),
  KEY `market_price` (`market_price`),
  KEY `shop_price` (`shop_price`),
  KEY `cost_price` (`cost_price`),
  KEY `goods_content` (`goods_content`(255)),
  KEY `is_on_sale` (`is_on_sale`),
  KEY `is_free_shipping` (`is_free_shipping`),
  KEY `is_new` (`is_new`),
  KEY `is_hot` (`is_hot`),
  KEY `goods_type_id` (`goods_type_id`),
  KEY `prom_type` (`prom_type`),
  KEY `sales_sum` (`sales_sum`),
  KEY `goods_prom_id` (`goods_prom_id`),
  KEY `shipping_area_ids` (`shipping_area_ids`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='商品表';

