-- ----------------------------
-- Table structure for `pc_order`
-- ----------------------------
DROP TABLE IF EXISTS `pc_order`;
CREATE TABLE `pc_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(20) NOT NULL DEFAULT '' COMMENT '订单编号',
  `users_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态:0侍支付，1待收货，2侍评价，3已取消，4已完成，5已作废',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '发货状态:0未发货，1已发货',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态:0未支付，1已支付',
  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人',
  `province_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '省份id',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '城市id',
  `area_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '县区id',
  `twon_id` int(11) DEFAULT '0' COMMENT '乡镇id',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '地址',
  `mobile` varchar(60) NOT NULL DEFAULT '' COMMENT '手机',
  `email` varchar(60) NOT NULL DEFAULT '' COMMENT '邮件',
  `shipping_code` varchar(32) NOT NULL DEFAULT '' COMMENT '物流code',
  `shipping_name` varchar(120) NOT NULL DEFAULT '' COMMENT '物流名称',
  `pay_code` varchar(32) NOT NULL DEFAULT '' COMMENT '支付code',
  `pay_name` varchar(120) NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `invoice_title` varchar(256) NOT NULL DEFAULT '' COMMENT '发票抬头',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总价',
  `shipping_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '邮费',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用余额',
  `coupon_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券抵扣',
  `integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '使用积分',
  `integral_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用积分抵多少钱',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '应付款金额',
  `total_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总价',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '下单时间',
  `shipping_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后新发货时间',
  `confirm_time` int(10) NOT NULL DEFAULT '0' COMMENT '收货确认时间',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间',
  `order_prom_id` smallint(6) NOT NULL DEFAULT '0' COMMENT '订单促销活动id',
  `order_prom_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '活动优惠金额',
  `discount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格调整',
  `user_note` varchar(255) NOT NULL DEFAULT '' COMMENT '用户备注',
  `admin_note` varchar(255) NOT NULL DEFAULT '' COMMENT '管理员备注',
  `parent_sn` varchar(100) NOT NULL DEFAULT '' COMMENT '父单单号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `users_id` (`users_id`),
  KEY `order_status` (`order_status`),
  KEY `pay_status` (`pay_status`),
  KEY `shipping_status` (`shipping_status`),
  KEY `pay_code` (`pay_code`),
  KEY `parent_sn` (`parent_sn`),
  KEY `order_prom_id` (`order_prom_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='订单表';

-- ----------------------------
-- Records of pc_order
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_order_action`
-- ----------------------------
DROP TABLE IF EXISTS `pc_order_action`;
CREATE TABLE `pc_order_action` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '订单id',
  `action_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '操作人id 0 为管理员操作',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '配送状态',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态',
  `action_note` varchar(255) NOT NULL DEFAULT '' COMMENT '操作备注',
  `log_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '操作时间',
  `status_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '状态描述',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `action_user_id` (`action_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='订单操作日志表';

-- ----------------------------
-- Records of pc_order_action
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_order_goods`
-- ----------------------------
DROP TABLE IF EXISTS `pc_order_goods`;
CREATE TABLE `pc_order_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '订单id',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '商品id',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_sn` varchar(60) NOT NULL DEFAULT '' COMMENT '商品货号',
  `goods_num` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '购买数量',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '市场价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本店价',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品成本价',
  `discount_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员折扣价',
  `give_integral` mediumint(8) NOT NULL DEFAULT '0' COMMENT '购买商品赠送积分',
  `spec_key` varchar(64) NOT NULL DEFAULT '' COMMENT '购买的商品规格key,对应pcgoods_spec_price表',
  `spec_key_name` varchar(64) NOT NULL DEFAULT '' COMMENT '购买的商品规格key_name,对应pcgoods_spec_price表',
  `bar_code` varchar(64) NOT NULL DEFAULT '' COMMENT '商品条码',
  `is_comment` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否评价',
  `prom_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 普通订单,1 限时抢购, 2 团购 , 3 促销优惠',
  `goods_prom_id` int(11) NOT NULL DEFAULT '0' COMMENT '活动id',
  `is_send` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未发货，1已发货，2已换货，3已退货',
  `ship_order_id` int(11) NOT NULL DEFAULT '0' COMMENT '发货单id',
  `sku` varchar(128) NOT NULL DEFAULT '' COMMENT 'sku',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`),
  KEY `ship_order_id` (`ship_order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='商品订单对应表';

-- ----------------------------
-- Records of pc_order_goods
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_plugin`
-- ----------------------------
DROP TABLE IF EXISTS `pc_plugin`;
CREATE TABLE `pc_plugin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(13) NOT NULL DEFAULT '' COMMENT '插件编码',
  `name` varchar(55) NOT NULL DEFAULT '' COMMENT '中文名字',
  `version` varchar(255) NOT NULL DEFAULT '' COMMENT '插件的版本',
  `author` varchar(30) NOT NULL DEFAULT '' COMMENT '插件作者',
  `config` text COMMENT '配置信息',
  `config_value` varchar(6000) NOT NULL DEFAULT '' COMMENT '配置值信息',
  `desc` varchar(255) NOT NULL DEFAULT '' COMMENT '插件描述',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否启用,0不启用，1启用',
  `type` varchar(50) NOT NULL DEFAULT '' COMMENT '插件类型:payment支付,login登陆,shipping物流',
  `icon` varchar(255) NOT NULL DEFAULT '' COMMENT '图标',
  `bank_code` varchar(255) NOT NULL DEFAULT '' COMMENT '网银配置信息',
  `scene` tinyint(1) NOT NULL DEFAULT '0' COMMENT '使用场景:0 PC+手机,1手机,2 PC',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=utf8 COMMENT='插件列表';

-- ----------------------------
-- Records of pc_plugin
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_region`
-- ----------------------------
DROP TABLE IF EXISTS `pc_region`;
CREATE TABLE `pc_region` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '表id',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '地区名称',
  `level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '地区等级 分省市县区',
  `parent_id` int(10) NOT NULL DEFAULT '0' COMMENT '父id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=47498 DEFAULT CHARSET=utf8 COMMENT='地区表';

-- ----------------------------
-- Records of pc_region
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_ship_order`
-- ----------------------------
DROP TABLE IF EXISTS `pc_ship_order`;
CREATE TABLE `pc_ship_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` mediumint(8) NOT NULL DEFAULT '0' COMMENT '订单id',
  `order_sn` varchar(64) NOT NULL DEFAULT '' COMMENT '订单编号',
  `users_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `admin_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单操作管理员id',
  `consignee` varchar(64) NOT NULL DEFAULT '' COMMENT '收货人',
  `zipcode` varchar(6) NOT NULL DEFAULT '' COMMENT '邮编',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '联系手机',
  `province_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '省份id',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '城市id',
  `area_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '县区id',
  `twon_id` int(11) DEFAULT '0' COMMENT '乡镇id',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '地址',
  `shipping_code` varchar(32) NOT NULL DEFAULT '' COMMENT '物流code',
  `shipping_name` varchar(64) NOT NULL DEFAULT '' COMMENT '快递名称',
  `shipping_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `invoice_number` varchar(255) NOT NULL DEFAULT '' COMMENT '物流单号',
  `tel` varchar(64) NOT NULL DEFAULT '' COMMENT '座机电话',
  `note` varchar(2000) NOT NULL DEFAULT '' COMMENT '管理员添加的备注信息',
  `best_time` int(11) NOT NULL DEFAULT '0' COMMENT '友好收货时间',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除:0否，1是',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `order_sn` (`order_sn`),
  KEY `users_id` (`users_id`),
  KEY `admin_id` (`admin_id`),
  KEY `province_id` (`province_id`),
  KEY `city_id` (`city_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='发货单表';

-- ----------------------------
-- Records of pc_ship_order
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_shipping_area`
-- ----------------------------
DROP TABLE IF EXISTS `pc_shipping_area`;
CREATE TABLE `pc_shipping_area` (
  `id` smallint(5) NOT NULL AUTO_INCREMENT,
  `shipping_area_name` varchar(150) NOT NULL DEFAULT '' COMMENT '配送区域名称',
  `shipping_code` varchar(50) NOT NULL DEFAULT '0' COMMENT '物流id',
  `config` varchar(20000) NOT NULL DEFAULT '' COMMENT '配置首重续重等...序列化存储',
  `update_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `is_default` tinyint(1) DEFAULT '0' COMMENT '是否默认:0否，1是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='物流插件列表';

-- ----------------------------
-- Records of pc_shipping_area
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_user_address`
-- ----------------------------
DROP TABLE IF EXISTS `pc_user_address`;
CREATE TABLE `pc_user_address` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '表id',
  `users_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人',
  `province_id` int(11) NOT NULL DEFAULT '0' COMMENT '省份id',
  `city_id` int(11) NOT NULL DEFAULT '0' COMMENT '城市id',
  `area_id` int(11) NOT NULL DEFAULT '0' COMMENT '地区id',
  `twon_id` int(11) DEFAULT '0' COMMENT '乡镇id',
  `address` varchar(120) NOT NULL DEFAULT '' COMMENT '详细地址',
  `mobile` varchar(60) NOT NULL DEFAULT '' COMMENT '手机',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为默认收货地址:0不，1是',
  PRIMARY KEY (`id`),
  KEY `users_id` (`users_id`),
  KEY `province_id` (`province_id`),
  KEY `city_id` (`city_id`),
  KEY `area_id` (`area_id`),
  KEY `twon_id` (`twon_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='用户收货地址表';

-- ----------------------------
-- Records of pc_user_address
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_user_level`
-- ----------------------------
DROP TABLE IF EXISTS `pc_user_level`;
CREATE TABLE `pc_user_level` (
  `id` smallint(4) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '头衔',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '消费多少达到',
  `discount` smallint(4) NOT NULL DEFAULT '100' COMMENT '折扣',
  `desc` varchar(200) NOT NULL DEFAULT '' COMMENT '描述',
  `sort` int(10) NOT NULL DEFAULT '10' COMMENT '排序',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `update_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `discount` (`discount`),
  KEY `amount` (`amount`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户等级表';

-- ----------------------------
-- Records of pc_user_level
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_users`
-- ----------------------------
DROP TABLE IF EXISTS `pc_users`;
CREATE TABLE `pc_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(60) NOT NULL DEFAULT '' COMMENT '邮箱',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '密码',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '姓别:0保密，1男，2女',
  `birthday` int(11) NOT NULL DEFAULT '0' COMMENT '生日',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '用户的钱',
  `frozen_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '冻结金额',
  `pay_points` int(11) NOT NULL DEFAULT '0' COMMENT '消费积分',
  `address_id` int(11) NOT NULL DEFAULT '0' COMMENT '默认收货地址id',
  `last_login` int(11) NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `last_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '最后登录ip',
  `qq` int(11) NOT NULL DEFAULT '0' COMMENT '扣扣',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号码',
  `mobile_validated` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否验证手机:0否，1是',
  `email_validated` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否验证邮箱:0否，1是',
  `oauth` varchar(10) NOT NULL DEFAULT '' COMMENT '第三方来源:wx，weibo，alipay',
  `openid` varchar(100) NOT NULL DEFAULT '' COMMENT '第三方唯一标识',
  `head_pic` varchar(255) NOT NULL DEFAULT '' COMMENT '头像',
  `province_id` int(6) NOT NULL DEFAULT '0' COMMENT '省id',
  `city_id` int(6) NOT NULL DEFAULT '0' COMMENT '市id',
  `town_id` int(6) NOT NULL DEFAULT '0' COMMENT '县id',
  `nickname` varchar(50) NOT NULL DEFAULT '' COMMENT '昵称',
  `level_id` tinyint(5) NOT NULL DEFAULT '1' COMMENT '会员等级',
  `discount` decimal(10,2) NOT NULL DEFAULT '1.00' COMMENT '会员折扣默认1无折扣',
  `total_amount` decimal(10,2) NOT NULL DEFAULT '1.00' COMMENT '累计消费额度',
  `is_lock` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否被锁定冻结:0否，1是',
  `token` varchar(64) NOT NULL DEFAULT '' COMMENT '用于app 授权类似于session_id',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '注册时间',
  `update_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `email` (`email`),
  KEY `nickname` (`nickname`),
  KEY `province_id` (`province_id`),
  KEY `city_id` (`city_id`),
  KEY `town_id` (`town_id`),
  KEY `address_id` (`address_id`),
  KEY `is_lock` (`is_lock`),
  KEY `level_id` (`level_id`),
  KEY `mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of pc_users
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_wx_account`
-- ----------------------------
DROP TABLE IF EXISTS `pc_wx_account`;
CREATE TABLE `pc_wx_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '公众号名称',
  `appid` varchar(50) NOT NULL DEFAULT '' COMMENT 'appid',
  `appsecret` varchar(50) NOT NULL DEFAULT '' COMMENT 'appsecret',
  `wxid` varchar(64) NOT NULL DEFAULT '' COMMENT '公众号原始id',
  `weixin` char(64) NOT NULL DEFAULT '' COMMENT '微信号',
  `header_pic` char(255) NOT NULL DEFAULT '' COMMENT '微信头像',
  `token` char(255) NOT NULL DEFAULT '' COMMENT '微信对接token',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类型',
  `web_access_token` varchar(200) NOT NULL DEFAULT '' COMMENT '网页授权token(access_token)',
  `web_expires` int(11) NOT NULL DEFAULT '0' COMMENT '过期时间',
  `qr` varchar(200) NOT NULL DEFAULT '' COMMENT 'qr',
  `status` tinyint(1) DEFAULT '0' COMMENT '微信接入状态,0待接入1已接入',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `name` (`name`),
  KEY `token` (`token`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='微信公众号表';

-- ----------------------------
-- Records of pc_wx_account
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_wx_images`
-- ----------------------------
DROP TABLE IF EXISTS `pc_wx_images`;
CREATE TABLE `pc_wx_images` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `keyword` char(255) NOT NULL DEFAULT '' COMMENT '关键词',
  `title` varchar(60) NOT NULL DEFAULT '' COMMENT '标题',
  `desc` varchar(3000) NOT NULL DEFAULT '' COMMENT '简介',
  `pic` char(255) NOT NULL DEFAULT '' COMMENT '封面图片',
  `url` char(255) NOT NULL DEFAULT '' COMMENT '图文外链地址',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `keyword` (`keyword`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='微信公众号图文关键词表';

-- ----------------------------
-- Records of pc_wx_images
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_wx_menu`
-- ----------------------------
DROP TABLE IF EXISTS `pc_wx_menu`;
CREATE TABLE `pc_wx_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '菜单名称',
  `type` tinyint(1) DEFAULT '0' COMMENT '菜单类型:0 view,1 click,2 scancode_push,3 scancode_waitmsg,4 pic_sysphoto,5 pic_photo_or_album,6 pic_weixin,7 location_select',
  `value` varchar(255) DEFAULT NULL COMMENT '菜单类型值',
  `wx_account_id` tinyint(1) NOT NULL DEFAULT '0' COMMENT '公众号id',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '上级菜单',
  `sort` int(5) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `wx_account_id` (`wx_account_id`),
  KEY `pid` (`pid`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='微信公众号菜单表';

-- ----------------------------
-- Records of pc_wx_menu
-- ----------------------------

-- ----------------------------
-- Table structure for `pc_wx_text`
-- ----------------------------
DROP TABLE IF EXISTS `pc_wx_text`;
CREATE TABLE `pc_wx_text` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `keyword` char(255) NOT NULL DEFAULT '' COMMENT '关键词',
  `content` varchar(3000) NOT NULL DEFAULT '' COMMENT '内容',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `keyword` (`keyword`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='微信公众号文本回复表';

-- ----------------------------
-- Records of pc_wx_text
