INSERT INTO `pc_article` VALUES ('1', '1', 'GIT使用小技巧大全', '<p>在大型软件工程的开发过程中，</p><p>版本控制是无法绕过去的；</p><p>目前来说，最火的版本控制软件就是GIT了。</p><p>早两年SVN比较火，</p><p><img src=\"http://p1.pstatp.com/large/192100005eff869f2831\" alt=\"GIT使用小技巧大全\"></p><p>不过被大神linus喷了几次后，</p><p>就日落西山了，</p><p>不过Linus也为我们贡献了GIT来替换SVN。</p><p><img src=\"http://p3.pstatp.com/large/191e00008b4746d3303a\" alt=\"GIT使用小技巧大全\"></p><p>今天咸蛋君会给大家介绍一些实用的git command，</p><p>常见的add/pull/push/branch command，大家肯定都会，咸蛋君也不会啰嗦，直接上干货。</p><ul><li><p>下面这个命令可以让你编辑最近一次的提交信息</p></li><li><p>git commit--amend -m ”YOUR-NEW-COMMIT\"</p></li><li><p>下面的命令强制推送这次的代码提交</p></li></ul><p>git push &lt;remote&gt;&lt;branch&gt; --force</p><ul><li><p>如果你往暂存区（staging area）中加入了一些错误的文件，但是还没有提交代码。你可以使用一条简单的命令就可以撤销</p></li></ul><p>git reset &lt;文件名&gt;</p><ul><li><p>有时候你可能会不小心提交了错误的文件或一开始就遗漏了某些东西</p></li></ul><p>git reset --soft HEAD</p><p>git add -A .</p><p>git commit -c ORIG_HEAD</p><ul><li><p>Git仓库撤销至前一次提交时的状态</p></li></ul><p>git checkout &lt;SHA&gt;</p><p>SHA是你想查看的提交拥有的哈希值（Hash Code）中前8至10个字符</p><p>怎么样？GIT的使用方法很复杂，但是功能也是很强大的</p><p><img src=\"http://p2.pstatp.com/large/1919000088760cbedfeb\" alt=\"GIT使用小技巧大全\"></p><p>大神Linus为了GIT也是颇下一番功夫！<img src=\"/uploads/article/1703/58ccb6536640d.png\" alt=\"58cb8b3fbb8b0\"></p><p><br></p><p><br></p>', '漂过太平洋', 'git', '', '在大型软件工程的开发过程中，版本控制是无法绕过去的；目前来说，最火的版本控制软件就是GIT了。', '0', '10', '0', '0', '\\uploads\\article\\1703\\58ccb864cce65.png', '2017-03-31 15:46:45', '2017-03-17 14:39:29', '2017-03-19 20:21:28');
