INSERT INTO `pc_wx_images` VALUES ('1', '功夫瑜伽', '功夫瑜伽-2017新片', '主演： 成龙 饰 Jack/ 李治廷 饰 Jones Lee/ 张艺兴 饰 Xiaoguang/ 母其弥雅 饰 未知/ 张国立 饰 未知/ 索努•苏德 饰 Randall/ 尚语贤/ 姜雯/ 伊利亚娜·狄克鲁兹\r\n看点： 喜剧寻宝1080p搞笑动作院线\r\n\r\n简介： 考古学教授Jack多年没有踏出学校，校长和学生都对他添油加醋的历史半信半疑。一次授课后，一个印度女孩找到Jack，用一张千年地图吸引了Jack的目光。于是Jack和挚友的儿子李琼斯、助教小光组成“寻宝小分队”，为“神秘宝石”展开冒险，在迪拜和土豪飙车，在冰岛潜入神秘冰穴，在印度大战土狼，和印度贵族斗舞，动作喜剧再升级，打笑全世界。', '/uploads/wechat/1704/58f3392d6505e.jpg', 'https://api.47ks.com/webcloud/?v=http://www.iqiyi.com/v_19rr9tqe9s.html?fc=87bbded392d221f5', '2017-02-09 21:25:50', '2017-04-16 20:25:39');
INSERT INTO `pc_wx_images` VALUES ('2', '西游伏妖篇', '西游伏魔-2017新电影', '作为《西游降魔篇》的后继故事，唐三藏在上集感化了杀死段小姐的齐天大圣，并收其为徒后，带着孙悟空、猪八戒及沙僧，一行四人踏上西天取经之旅，路途凶险，除魔伏妖，师徒四人也在取经的过程中有个各自的成长与改变。', '/uploads/wechat/1704/58f332ba8345b.jpg', 'https://api.47ks.com/webcloud/?v=http://www.iqiyi.com/v_19rr9tq5fg.html?fc=87bbded392d221f5', '2017-04-16 17:00:44', '2017-04-16 17:40:47');
INSERT INTO `pc_wx_images` VALUES ('3', '大闹天竺', '大闹天竺-2017新片', '主演： 王宝强 饰 武空/ 白客 饰 唐森/ 岳云鹏 饰 朱天鹏/ 柳岩 饰 吴静/ 黄渤/ 林永健/ 马浴柯/ 陈佩斯/ 朱时茂/ 王祖蓝/ 刘昊然/ 六小龄童\r\n看点： 喜剧寻宝友谊亲情1080p搞笑\r\n简介： 盛唐集团总裁唐宗突然离世并留下遗训，让他的儿子唐森在穷小子武空的陪同下前往印度寻找遗嘱。在印度巧遇自恋臭美却又忠诚的朱天鹏，以及美丽性感却深藏秘密的美女吴静，四人兜兜转转竟结为同盟，而最令四人不解的是为何这次取遗嘱之旅凶险重重，危机四伏,并且遗嘱之所以放在印度，更是隐藏着秘密', '/uploads/wechat/1704/58f339c98f2f4.jpg', 'https://api.47ks.com/webcloud/?v=http://www.iqiyi.com/v_19rr9tq8ps.html?fc=87bbded392d221f5', '2017-04-16 17:30:59', '0000-00-00 00:00:00');
INSERT INTO `pc_wx_images` VALUES ('4', '斗战胜佛', '斗战胜佛-17年新片', '主演： 陈浩民/ 林子聪/ 蓝燕/ 马泽涵\r\n看点： 奇幻功夫超自然暴力温暖网络大电影\r\n简介： 恶念的化身修罗女王（蓝燕饰）将孙悟空留在五行山下的怨气凝聚成了一只黑暗猴子，告诉黑暗猴子只要打败了齐天大圣，就可以变成斗战胜佛。孙悟空在取经之后把自己的肉身放在人间修行，这个肉身叫孙小凡（陈浩民饰），是个不得志的漫画师（执着于画出西游故事，却得不到出版商赏识），黑暗猴子需要先把孙小凡肉身内的齐天大圣激发出来再打败才能实现目的。 黑暗猴子在五行山与二郎神大战一场。二郎神战败，怀疑黑暗猴子不是孙悟空。黑暗猴子将一根毫毛吹入人间，不断在孙小凡周围制造各种险境，只为激发孙小凡成为真正的齐天大圣。 为了找到孙小凡以拯救被黑暗猴子搅和得一团乱的天庭，猪八戒（林子聪饰）来到人间。化为人形的猪八戒在快餐店大快朵颐，许多杯可乐下肚后，突然现出了猪的原形。 孙小凡在孤儿院有个青梅竹马的女性伙伴叫铁兰儿，铁兰儿生性直爽泼辣，孙小凡又头疼她又喜欢她。孤儿院老张院长一直看着他俩长大，早就认定他俩是天生一对，一直想要撮合他们。 孙小凡去漫画社投稿，遇见了苛刻的双胞胎老板，饱受挫折......', '/uploads/wechat/1704/58f33abe425e4.jpg', 'https://api.47ks.com/webcloud/?v=http://www.iqiyi.com/v_19rrapsmcs.html?fc=87bbded392d221f5', '2017-04-16 17:34:45', '2017-04-16 17:34:55');
INSERT INTO `pc_wx_images` VALUES ('5', '奇幻森林', '奇幻森林-17年新片', '主演： 尼尔·塞西 饰 狼孩毛克利/ 比尔·默瑞 饰 棕熊巴鲁（英文配音）/ 本·金斯利 饰 黑豹巴希拉（英文配音）/ 伊德瑞斯·艾尔巴 饰 老虎谢利·可汗（英文配音）/ 斯嘉丽·约翰逊 饰 巨蟒卡奥（英文配音）\r\n\r\n看点： 虚拟时空野外生存奇幻高大上正太1080p\r\n\r\n简介： 茂密的原始森林中，生活着人类小孩毛克利。因某种原因他很小就成为了孤儿，黑豹巴希拉最先找到了他，并将毛克利托付给狼族的首领阿克拉。从此以后，毛克利以狼的身份在森林里成长起来，和他的兄弟姐妹们学习捕猎和求生技巧。然而并非所有动物都接受毛克利的存在，特别是曾被人类伤害的老虎谢利·可汗，更将男孩视为眼中钉肉中刺。谢利·可汗向狼族发出威胁，众狼们不得不为族群的命运做出考量。毛克利不希望“家人”为难，他选择离开狼群，而唯一陪伴他的巴希拉则希望带着男孩回归人类世界。即便如此，谢利·可汗也绝不肯善罢甘休，他对男孩展开了无休止的追杀……', '/uploads/wechat/1704/58f33b49d8b9c.jpg', 'https://api.47ks.com/webcloud/?v=http://www.iqiyi.com/v_19rrljx3q8.html?fc=87bbded392d221f5', '2017-04-16 17:37:15', '0000-00-00 00:00:00');
